function ParentComponent() {
  const [count, setCount] = useState(0);
  
  // This function is memoized and only changes if dependencies change
  const handleClick = useCallback(() => {
    setCount(count + 1);
  }, [count]);

  return (
    <div>
      <ChildComponent onClick={handleClick} />
      <p>Count: {count}</p>
    </div>
  );
}
